import React from "react";
import styled from "styled-components";

const SignUp = () => {
    return(
        <Center>
            <Wrapper>
                <SignUpText>회원가입</SignUpText>
                <div>
                    <Text>이름</Text>
                    <TextInput />
                </div>
                <div>
                    <Text>아이디</Text>
                    <TextInput />
                </div>
                <div>
                    <Text>비밀번호</Text>
                    <TextInput />
                </div>
                <div>
                    <Text>비밀번호 확인</Text>
                    <TextInput />
                </div>
                <Btn>완료</Btn>
            </Wrapper>
        </Center>
    )
}

export default SignUp

const SignUpText = styled.div`
    font-weight: 700;
    font-size: 28px;
    margin-top: 40px;
    margin-bottom: 16px;
`

const Text = styled.div`
    font-weight: 700;
    font-size: 16px;
    margin-top: 10px;
    margin-bottom: 10px;
`

const TextInput = styled.input`
    width: 350px;
    border: 1px solid #999999;
    border-color: #999999;
    border-radius: 4px;
    border-width: 1.45px;
    padding: 16px 16px;
`

const Center = styled.div`
    display: flex;
    justify-content: center;
    margin-top: 100px;
    min-height: 80vh;
`

const Wrapper = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    border: 1px solid gray;
    width: 490px;
    height: 580px;
`

const Btn = styled.button`
    margin-top: 30px;
    width: 384px;
    height: 48px;
    border-radius: 4px;
    border-width: 0px;
    background-color: #E0E0E0;
    font-weight: 700;
    font-size: 16px;
    color: white;
`
